import React, { Component } from "react";
import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, NavbarDefault, NavDropdown, Glyphicon } from "react-bootstrap";
import Home from "./Home";
import Stuff from "./Stuff";
import Contact from "./Contact";
import "./Main.scss";

class Main extends Component {
  render() {
    return (
      <HashRouter>
        <div className="container">

          <div id="header">
      <div className="container">
        <div className="row align-items-end">
          <div className="SRL_Logo col-md-6 col-12">
            <img
              src={SRLLogo}
              alt="Simple React Lightbox - A simple but functional light-box for React"
            />
          </div>
          <div className="col-md-6 col-12">
            <nav>
              <ul>
                <li>
                  <Navlink to="/">Mixed content</Navlink>
                </li>
                <li>
                  <Navlink to="/example-two/">Mixed content - Page 2</Navlink>
                </li>
                <li>
                  <Navlink to="/gallery-with-links/">Gallery with links</Navlink>
                </li>
              </ul>
            </nav>
          </div>
        </div>
      </div>
    </div>
          <div className="content">
            <Route exact path="/" component={Home}/>
            <Route path="/stuff" component={Stuff}/>
            <Route path="/contact" component={Contact}/>
          </div>
        </div>
      </HashRouter>
    );
  }
}

export default Main;
